import React from 'react';
import '../App'
import descarga from '../../public/Static/descarga.jpg'

class Navigation extends React.Component {
    render() {
        return (
        <nav class="navbar navbar-expand-lg navbar-light bg-light">
            <div class="container-fluid">
                <a class="navbar-brand" href="#">
                    <img src={descarga} alt="Logo!" class="img-fluid" />
                </a>
            
                <div class="collapse navbar-collapse ms-lg-3" >
                        <ul class="navbar-nav me-auto mb-2 mb-lg-0">
                            <li class="nav-item">
                                <a class="nav-link active" aria-current="page" href="#">Inicio</a>
                            </li>
                            <li class="nav-item">
                                <a class="nav-link active" href="#">Acerca de </a>
                            </li>
                            <li class="nav-item">
                                <a class="nav-link  active" href="#">Contactanos </a>
                            </li>
                        </ul>
                </div>
            </div>
        </nav>
        );
    }
}

export default Navigation;
